function DirectorList(){}DirectorList.prototype.listenDelEvent=function(){$(".del-btn").click(function(t){t.preventDefault();var i=$(this).attr("data-director-id"),r=$(this).attr("data-director-name");acalert.alertConfirm({msg:"确定要开除"+r+"吗?",confirmCallback:function(){acajax.post({url:"/del_director/",data:{director_id:i},success:function(t){acalert.alertSuccess({title:"欧耶~",msg:"恭喜你炒了"+r+"！TA要喝西北风了！",confirmCallback:function(){window.location.reload()}})}})}})})},DirectorList.prototype.run=function(){this.listenDelEvent()},$(function(){(new DirectorList).run()});